import React from 'react';
import '../public/BubbleTracker.css';
import FlipkartBubbleTracker from './BubbleTracker';
const initialBubbles = [
  { id: 1, x: 20, y: 75 },
  { id: 2, x: 40, y: 75 },
  { id: 3, x: 60, y: 75 },
  { id: 4, x: 80, y: 75 },
  { id: 5, x: 100, y: 75 },
];

function Tracking_App() {
  const variableValue = 2; 
  
  return (
    <div className="App">
      <FlipkartBubbleTracker bubbles={initialBubbles} variableValue={variableValue} />
    </div>
  );
}

export default Tracking_App;
